    false,nt"url": null,nt"notes": "This narrative report for Union Slough
    NWR outlines Refuge accomplishments from January through April of 1950. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments and plantings. The public relations section of the
    report describes recreational uses, Refuge visitors, Refuge participation, fishing,
    and violations. Items of interest and N-R forms are attached.",nt"owner_org":
